import React from "react";
import "../styles/UserPage.css";

const UserGrid = ({ workouts }) => {
  return (
    <div className="user-grid">
      <h2>Your Workouts</h2>
      <table className="styled-table">
        <thead>
          <tr>
            <th>Title</th>
            <th>
              <i class="fas fa-dumbbell"></i> Load (kg)
            </th>
            <th>
              <i class="fas fa-sync-alt"></i> Reps
            </th>
          </tr>
        </thead>
        <tbody>
          {workouts.length > 0 ? (
            workouts.map((workout) => (
              <tr key={workout._id}>
                <td>{workout.title}</td>
                <td>{workout.load}</td>
                <td>{workout.reps}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="3">No workouts found.</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default UserGrid;
